Verifying your identity
(For Enterprise Emergency Phone Support)
For account security, you must verify your identity and account ownership in the Cloudflare dashboard before discussing account settings and sensitive details with Cloudflare Support. There are two verification options:

a single-use token that automatically refreshes every thirty (30) seconds, or
an authenticator app token on your mobile device.

Authenticating your account
1. Log into your Cloudflare account.
2. In the upper right corner of the Cloudflare dashboard, click Support and select Contact Support.

3. On the right-hand panel there is a section for Emergency Phone Support Hotline.

4. To authenticate using a single-use token, click Get a single-use token. A pop-up window will appear with your Unique Customer Id and One Time Passcode. The code automatically refreshes every 30 seconds.

5. To authenticate using an authenticator app, click Configure authenticator app and follow the configuration instructions on the following screen. After configuration, the token code will appear in your mobile authentication application.
6. When calling the emergency phone line, you can authenticate automatically by entering your ID and Code when requested.

Getting help with an issue
To submit a support case, follow these steps:

Browse to https://dash.cloudflare.com/?to=/:account/support ↗.
Enter the email and password for your Cloudflare account. Your email needs to be verified in order to submit a Support case.
Select the appropriate account requiring assistance.
Verify that you are now in the Support Portal.
Choose the category and subcategories that best define your issue.
Choose the affected domains (if applicable).
Enter a detailed summary of the issue you’re experiencing.
Review the right-hand panel of the Portal for recommended resources and for troubleshooting guides resulting from diagnostics run against your domain.
If the provided resources did not solve your issue, click Add more details to submit a case**
Complete the case submission fields as completely as possible with the following information. (Please note that missing information will increase the time it takes to resolve your issue and our team may not be able to investigate without enough information. Please review Gathering information for troubleshooting sites and make sure you include all needed information.)
-   A detailed description of the issue with the following information:

Timestamp (UTC)
ZoneName/ZoneID
Problem frequency
Steps to reproduce the issue, with actual results vs expected results
-   Any necessary information for a technical investigation
A description of the actual results vs expected results
Steps to reproduce the issue, with example URLs 
Exact error messages
HAR files
Screenshots
Relevant logs from the origin web server
Output from test tools such as MTR, traceroute, dig/nslookup, and cURL
-   Priority level, impact to service / production
- Any collaborators whom you wish to be cc'd on the case


Click Submit Case

** Available to certain plan types only. Refer to chart above for details.
Accepted file formats in cases and chats
You can only upload the following file types in a case or a chat:
Image

png, jpg, gif, ico, tiff

Video

mp4, avi, webm

Text

har, txt, csv, eml, css, html, json, tf

Cloudflare Support only accepts the WARP diagnostics as compressed files.
Please do not upload ZIP or RAR files when sharing HAR files, and please do not share compressed documents like DOCX, XLSX or PPTX.
The maximum file size is 20 MB.
If you need to share a larger file, please provide a link to the file using Google Drive or a similar sharing platform of your choice.
View open support cases

Log in to your Cloudflare account.
Select My Activities - All Tickets from Support dropdown.
Select your account if needed.
You will be redirected to the portal where you can see your own cases and cases you are CC'd on.

Add participants to open support tickets

Log in to your Cloudflare account.
Select My Activities - All Tickets from Support dropdown.
Select your account if needed.
Select the case you want to add participants to.
Enter their email in the Case Participants box in the top right and click Add.


Live chat support
You can also use the live chat (Business and Enterprise plans, only) to ask specific questions that don’t require a lot of technical investigation:

Browse to https://dash.cloudflare.com/?to=/:account/support ↗.
Enter the email and password for your Cloudflare account. Your email needs to be verified in order to chat live with us.
Select the appropriate account requiring assistance.
Click the Help icon in the bottom right corner of the screen
The Live Chat screen will appear. Use the search field to check for answers to your questions:
If the results didn't answer your question, press the Live chat button and start typing your message to chat with a Technical Support Engineer.


Service Level Agreements and Objectives
How we prioritize your issue
Cloudflare support responds to every case received in the following priority order:

